Değerli kullanıcılar, Merhaba:
Kullanıcılara daha iyi hizmet verebilmek ve daha profesyonel sözleşme hizmetleri sunmak için kalıcı sözleşmenin yeni web sürümü ve APP sürümü yakında kullanıma sunulacak.
1. Resmi geçişten önce, kullanmanız için çift versiyonlu bir sözleşme sistemi sunuyoruz. Aynı zamanda, yeni sözleşme yeni başladığında, birçok kusur olabilir. Bir hata veya herhangi bir öneri bulursanız, lütfen şu bağlantı aracılığıyla gönderin:
2. O zaman, eski sözleşme sistemi erişimi durduracaktır. Eski sözleşmenin kullanıcıları, pozisyonlarını zamanında kapatmalı ve karşılık gelen zamandan önce varlıklarını döviz hesabına transfer etmelidir; zamanında kapanmaz ve transfer edilmezse, platform o andaki piyasa fiyatına dayanacaktır. Otomatik tasfiye ve takas ve varlıkların döviz hesaplarına aktarılması; doldurulmayan siparişler sistem tarafından otomatik olarak iptal edilecektir.
3. Gezinme üst kayan katmanı aracılığıyla eski ve yeni sözleşmeler arasında serbestçe geçiş yapabilirsiniz. [Yeni/eski sürümü değiştir]'e tıkladıktan sonra, sözleşme işlemlerine, sözleşme varlıklarına, sözleşme emirlerine ve sözleşmeyle ilgili işlem işlevlerine eriştiğinizde aynı anda geçiş yapacaksınız; sözleşme Verilerinin eski ve yeni sürümlerinin birlikte çalışabilir olmadığını lütfen unutmayın;
Etkilenen işlevler şunları içerir ancak bunlarla sınırlı değildir: sözleşme komisyoncusu, sözleşme deneyim ücreti, sözleşme belgeseli, sözleşme yarışması;
4. Sözleşme varlıklarınızın sözleşme hesabına aktarılmadan önce döviz hesabına aktarılması gerekir;
